import Paper from "@mui/material/Paper"
import Grid from "@mui/material/Grid"
import Container from "@mui/material/Container"
import { MainCardsDiv } from "../mui_css/styledComponents"

const classes = {
  root: {
    flexGrow: 1
  },
  paper: {
    padding: 20,
    textAlign: "center",
    backgroundColor: "black",
    color: "white"
  }
};
const MainPannel = () =>{
    return(
        <Container maxWidth="xl">
			<MainCardsDiv>
				<Grid container bgcolor="tertiary.main" padding="0px 20px 20px 0px" spacing={2} justifyContent="center">
					{/* xs = mobile size */}
					<Grid item xs={12} sm={6} md={4} lg={1} xl={1}>
						<Paper style={{height:'150px' ,width:'300px',}} />
					</Grid>
					<Grid item xs={12} sm={6} md={4} lg={1} xl={1}>
						<Paper style={{height:'150px' ,width:'300px',}} />
					</Grid>
					<Grid item xs={12} sm={6} md={4} lg={1} xl={1}>
						<Paper style={{height:'150px' ,width:'300px',}} />
					</Grid>
					<Grid item xs={12} sm={6} md={4} lg={1} xl={1}>
						<Paper style={{height:'150px' ,width:'300px',}} />
					</Grid>
					<Grid item xs={12} sm={6} md={4} lg={1} xl={1}>
						<Paper style={{height:'150px' ,width:'300px',}} />
					</Grid>
				</Grid>
			</MainCardsDiv>
        </Container>
    )   
}
export default MainPannel;
